import { FaShoppingCart, FaUser } from "react-icons/fa";
import logo from "../assets/logo.png";

const Header = () => {
  return (
    <body className="bg-gray-400">
      <header className="flex justify-between fixed top-0 left-0 right-0 z-50 ">
        <div className="flex items-center">
          <img src={logo} alt="" />
          <p className="text-2xl ">ProShop</p>
        </div>
        <div>Hello</div>
      </header>
    </body>
  );
};

export default Header;
